import Typical from 'react-typical';
//▹
class Code extends Component {
  render() {
    return (
      <div>
        <div>
          <h4 className="tc neon">I AM AN avid watcher of anime...</h4>
        </div>
        <div className="flex flex-wrap justify-center neon">
          <p className="mr1">▹ I have </p>
          <p className='dim'>
            <Typical
              steps={[
                "watched 200 anime",
                1500,
                "watching 15 anime",
                1500,
                "planning to watch 20 anime"
                ]}
              loop={Infinity}
              wrapper="b"
            />
          </p>
        </div>
      </div>
    );
  }
}

export default Code;
